from typing import *
def f_gold(security: List[int], time: int) -> List[int]:
    n = len(security)
    if n <= time * 2:
        return []
    left, right = [0] * n, [0] * n
    for i in range(1, n):
        if security[i] <= security[i - 1]:
            left[i] = left[i - 1] + 1
    for i in range(n - 2, -1, -1):
        if security[i] <= security[i + 1]:
            right[i] = right[i + 1] + 1
    return [i for i in range(n) if time <= min(left[i], right[i])]
